  false,\n\t\"url\": null,\n\t\"notes\": \"According to Iowa law, a u201cPerpetual
  Care Cemeteryu201d is a cemetery which has established an irrevocable trust fund
  for the maintenance, repair, and care of all interment spaces, features, buildings,
  roadways, parking lots, water supply, and other existing cemetery structures.  All
  new cemeteries that were organized or that commenced business in Iowa on or after
  July 1, 1995, must operate as a perpetual care cemetery.  Cemeteries that were organized
  before that date may or may not be perpetual care cemeteries.\",\n\t\"owner_org\":
